<h2> 思路</h2>
<p>动态规划用于解决某一问题有很多重叠子问题的情况，其<mark>每一个状态一定是由上一个状态推导出来的</mark>，这与贪心算法不同，贪心没有状态推导，而是从局部直接选最优的</p>
<p>动态规划有 5 个步骤：</p>
<ol>
<li>确定 dp 数组（dp table）以及下标的含义</li>
